css:
.nuclide-console {
  display: flex;
  flex-direction: column;
  width: 100%;
  background-color: #2e2e2e;
}
.nuclide-console .icon {
  vertical-align: middle;
}
.nuclide-console .nuclide-ui-toolbar {
  background-color: #2e2e2e;
}
.nuclide-console-record .icon:before,
.nuclide-console-record pre,
.nuclide-console atom-text-editor {
  font-size: 10.8px;
}
.nuclide-console-scroll-pane {
  overflow-y: auto;
  overflow-x: hidden;
  background-color: #2e2e2e;
  transform: translate3d(0, 0, 0);
}
.nuclide-console-record {
  display: flex;
  align-items: center;
  padding: 1px 5px;
  background-color: #2e2e2e;
  border-radius: 0;
  border-top: 1px solid #1c1c1c;
}
.nuclide-console-record pre {
  background-color: transparent;
  color: #d6d6d6;
  word-break: normal;
  white-space: pre-wrap;
}
.nuclide-console-record .icon {
  color: #d6d6d6;
  text-align: center;
}
.nuclide-console-record .icon,
.nuclide-console-record .icon::before {
  font-size: 11px;
}
.nuclide-console-record .icon::before {
  width: 11px;
  height: 11px;
}
.nuclide-console-record:first-child {
  border-top: none;
}
.nuclide-console-record:last-child {
  border-bottom: 1px solid #1c1c1c;
}
.nuclide-console-record.level-info .icon {
  color: rgba(214, 214, 214, 0.7);
}
.nuclide-console-record.level-warning {
  background-color: #e6c299;
  border-color: #cc8533;
}
.nuclide-console-record.level-warning + :not(.level-error) {
  border-top-color: #cc8533;
}
.nuclide-console-record.level-warning pre,
.nuclide-console-record.level-warning .nuclide-ui-lazy-nested-value div,
.nuclide-console-record.level-warning .nuclide-ui-lazy-nested-value span {
  color: #835b21;
}
.nuclide-console-record.level-warning .icon {
  color: #cc8533;
}
.nuclide-console-record.level-error {
  background-color: #ec9393;
  border-color: #d92626;
}
.nuclide-console-record.level-error + .nuclide-console-record {
  border-top-color: #d92626;
}
.nuclide-console-record.level-error pre,
.nuclide-console-record.level-error .nuclide-ui-lazy-nested-value div,
.nuclide-console-record.level-error .nuclide-ui-lazy-nested-value span {
  color: #7a1200;
}
.nuclide-console-record.level-error .icon {
  color: #d92626;
}
.nuclide-console-record.level-red {
  background-color: #ec9393;
}
.nuclide-console-record.level-red pre,
.nuclide-console-record.level-red .nuclide-ui-lazy-nested-value div,
.nuclide-console-record.level-red .nuclide-ui-lazy-nested-value span {
  color: #7a1200;
}
.nuclide-console-record.level-orange {
  background-color: #e6c299;
}
.nuclide-console-record.level-orange pre,
.nuclide-console-record.level-orange .nuclide-ui-lazy-nested-value div,
.nuclide-console-record.level-orange .nuclide-ui-lazy-nested-value span {
  color: #291b0a;
}
.nuclide-console-record.level-yellow {
  background-color: #f9f5cd;
}
.nuclide-console-record.level-yellow pre,
.nuclide-console-record.level-yellow .nuclide-ui-lazy-nested-value div,
.nuclide-console-record.level-yellow .nuclide-ui-lazy-nested-value span {
  color: #3f3a08;
}
.nuclide-console-record.level-green {
  background-color: #70e6be;
}
.nuclide-console-record.level-green pre,
.nuclide-console-record.level-green .nuclide-ui-lazy-nested-value div,
.nuclide-console-record.level-green .nuclide-ui-lazy-nested-value span {
  color: #020906;
}
.nuclide-console-record.level-blue {
  background-color: #80c3ff;
}
.nuclide-console-record.level-blue pre,
.nuclide-console-record.level-blue .nuclide-ui-lazy-nested-value div,
.nuclide-console-record.level-blue .nuclide-ui-lazy-nested-value span {
  color: #001b33;
}
.nuclide-console-record.level-purple {
  background-color: #ec9cd9;
}
.nuclide-console-record.level-purple pre,
.nuclide-console-record.level-purple .nuclide-ui-lazy-nested-value div,
.nuclide-console-record.level-purple .nuclide-ui-lazy-nested-value span {
  color: #330a29;
}
.nuclide-console-record.level-violet {
  background-color: #f4c7ea;
}
.nuclide-console-record.level-violet pre,
.nuclide-console-record.level-violet .nuclide-ui-lazy-nested-value div,
.nuclide-console-record.level-violet .nuclide-ui-lazy-nested-value span {
  color: #5e124c;
}
.nuclide-console-record pre {
  display: inline;
  padding: 0;
  background-color: transparent;
}
.nuclide-console-record.request {
  display: flex;
  background-color: #2e2e2e;
}
.nuclide-console-record.request,
.nuclide-console-record.response {
  opacity: 0.7;
}
.nuclide-console-record-content-wrapper {
  width: 100%;
  padding-bottom: 1px;
}
.nuclide-console-record-source-label {
  display: inline-block;
  float: right;
  margin: 2px 0 0 4px;
  white-space: nowrap;
  font-size: 0.8em;
}
.nuclide-console-input-wrapper {
  display: flex;
  background-color: #2e2e2e;
  padding: 1px 0;
  flex-grow: 1;
}
.nuclide-console-prompt {
  display: flex;
  padding: 5px 5px;
  border-top: 1px solid #1c1c1c;
  background-color: #2e2e2e;
  color: #d6d6d6;
  min-height: 30px;
}
.nuclide-console-prompt-wrapper {
  display: flex;
  align-items: center;
  white-space: nowrap;
}
.nuclide-console-prompt-label {
  text-transform: uppercase;
  font-weight: bold;
  font-size: 0.8em;
  padding-right: 1em;
}
.nuclide-console-text-editor-wrapper {
  flex-grow: 1;
}
.nuclide-console-scroll-pane-wrapper {
  position: relative;
  display: flex;
  flex-direction: column;
  overflow: hidden;
}
.nuclide-console-new-messages-notification {
  position: absolute;
  bottom: 0;
  left: 50%;
  text-align: center;
  padding-left: 10px;
  padding-right: 10px;
  cursor: pointer;
  transition: all 0.3s cubic-bezier(0.175, 0.885, 0.32, 1.275);
}
.nuclide-console-new-messages-notification.visible {
  margin-bottom: 5px;
  transform: translateX(-50%) translateY(0);
}
.nuclide-console-new-messages-notification:not(.visible) {
  margin-bottom: 0;
  transform: translateX(-50%) translateY(100%);
}
.nuclide-console-new-messages-notification-icon {
  text-align: left;
}
.nuclide-console-new-messages-notification-icon::before {
  width: auto;
}
atom-text-editor[mini].nuclide-console-filter-field {
  float: left;
  border-bottom-right-radius: 0;
  border-top-right-radius: 0;
}
atom-text-editor[mini].nuclide-console-filter-field.is-focused {
  z-index: 1;
}
atom-text-editor[mini].nuclide-console-filter-field.invalid {
  background-color: #ec9393;
  color: #7a1200;
  border-color: #d92626;
}
.btn.nuclide-console-filter-regexp-button {
  position: relative;
  left: -1px;
  font-weight: bold;
  font-family: Menlo, monospace;
}
.nuclide-console-header-icon-fill {
  fill: #a8a8a8;
}
.nuclide-console-header-filter-icon {
  width: 12px;
}
